import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook } from '@fortawesome/free-brands-svg-icons';

function Footer() {
	return (
		<footer>
			<div className='inner'>
				<ul>
					<li>
						<a href=''>
							<FontAwesomeIcon icon={faFacebook}></FontAwesomeIcon>
						</a>
					</li>
					<li>
						<a href=''></a>
					</li>
					<li>
						<a href=''></a>
					</li>
				</ul>
			</div>
		</footer>
	);
}

export default Footer;
